import logo from './logo.svg';
import './App.css';
import Login from './pages/Login';

function App() {
  return (
   <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/forgot" element={<ForgotPassword />} />
        <Route path="/Fortich-Dashboard" element={<FortichDashboard />} />
        <Route path="/Ivan-Dashboard" element={<IvanDashboard />} />
        <Route path="/Rose-Dashboard" element={<RoseDashboard />} />
        <Route path="/Baer-Dashboard" element={<BaerDashboard />} />
        <Route path="/ComingSoon" element={<ComingSoon sectionName="Dashboard" />} />
      </Routes>
  );
}

export default App;
